export default {
  components: {
    caiGou: caiGou,
    dialogWlxzbycglx: dialogWlxzbycglx
  },
  data: function data() {
    return {
      DICT_CODE: DICT_CODE,
      dialogStatus: '',
      dialogVisible: false,
      temp: {}
    };
  },
  methods: {
    //获取组织编码名称
