      this.$refs.wlxz.dialogVisible = true;
    },
    //物料选择弹框确定
    confirmWlxz: function confirmWlxz(val) {
      this.$set(this.temp, 'materialName', val[0].materialName);
      this.$set(this.temp, 'materialCode', val[0].materialCode);
    },
    create: function create() {},
    update: function update() {},
    resetTemp: function resetTemp() {
      this.temp = {};
    }
  }
};
